import React from 'react';
import Radio from './Radio';

function Answer({quesType, quesNo, ansNo, ansText})
{
    return(
        <tr>
            <td>
                {quesType == 'R'?<Radio/>:
                <div><input type='checkbox' name = {quesNo} value = {ansNo}/><label>{ansText}</label></div>}
            </td>
        </tr>
    )
}
export default Answer;
